('Piel Eléctrica', 'galvanize', 'Normal-type moves become Electric-type moves. The power of those moves is boosted a little.', 'Convierte los movimientos de tipo Normal en tipo Eléctrico y aumenta ligeramente su potencia.'),
('Cola Surf', 'surge-surfer', 'Doubles the Pokémon’s Speed stat on Electric Terrain.', 'Duplica la Velocidad si hay un campo eléctrico en el terreno de combate.'),
('Banco', 'schooling', 'When it has a lot of HP, the Pokémon forms a powerful school. It stops schooling when its HP is low.', 'Forma bancos con sus congéneres cuando tiene muchos PS, lo cual le otorga más fuerza. Cuando le quedan pocos PS, el banco se dispersa.'),
('Disfraz', 'disguise', 'Once per battle, the shroud that covers the Pokémon can protect it from an attack.', 'Permite eludir un único ataque valiéndose de la tela que le cubre el cuerpo.'),
('Fuerte Afecto', 'battle-bond', 'Defeating an opposing Pokémon strengthens the Pokémon’s bond with its Trainer, and it becomes Ash-Greninja. Water Shuriken gets more powerful.', 'Al derrotar a un rival, los vínculos con su Entrenador se refuerzan y se convierte en Greninja Ash. Su Shuriken de Agua también se ve potenciado.'),
('Agrupamiento', 'power-construct', 'Other Cells gather to aid when its HP becomes half or less. Then the Pokémon changes its form to Complete Forme.', 'Cuando sus PS se ven reducidos a la mitad, las células se reagrupan y adopta su Forma Completa.'),
('Corrosión', 'corrosion', 'The Pokémon can poison the target even if it’s a Steel or Poison type.', 'Permite envenenar incluso a rivales de tipo Acero o Veneno.'),
('Letargo Perenne', 'comatose', 'It’s always drowsing and will never wake up. It can attack without waking up.', 'No despierta jamás de su profundo letargo  e incluso ataca dormido.'),
('Regia Presencia', 'queenly-majesty', 'Its majesty pressures the opposing Pokémon, making it unable to attack using priority moves.', 'Intimida al rival y le impide usar movimientos con prioridad dirigidos al Pokémon.'),
('Revés', 'innards-out', 'Damages the attacker landing the finishing hit by the amount equal to its last HP.', 'Al caer debilitado, inflige al rival un daño equivalente a los PS que le quedaran.'),
('Pareja de Baile', 'dancer', 'When another Pokémon uses a dance move, it can use a dance move following it regardless of its Speed.', 'Permite copiar inmediatamente cualquier movimiento de baile que haya usado otro Pokémon presente en el combate.'),
('Batería', 'battery', 'Powers up ally Pokémon’s special moves.', 'Potencia los movimientos especiales de los aliados.'),
('Peluche', 'fluffy', 'Halves the damage taken from moves that make direct contact, but doubles that of Fire-type moves.', 'Reduce a la mitad el daño provocado por los movimientos de contacto, pero duplica el infligido por los de tipo Fuego.'),
('Cuerpo Vívido', 'dazzling', 'Surprises the opposing Pokémon, making it unable to attack using priority moves.', 'Desconcierta al rival y le impide utilizar movimientos con prioridad contra el usuario.'),
('Coránima', 'soul-heart', 'Boosts its Sp. Atk stat every time a Pokémon faints.', 'Aumenta el Ataque Especial cada vez que un Pokémon cae debilitado.'),
('Rizos Rebeldes', 'tangling-hair', 'Contact with the Pokémon lowers the attacker’s Speed stat.', 'Baja la Velocidad del rival cuando este ataca al Pokémon con un movimiento de contacto.'),
('Receptor', 'receiver', 'The Pokémon copies the Ability of a defeated ally.', 'Adquiere la habilidad de un aliado debilitado.'),
('Reacción Química', 'power-of-alchemy', 'The Pokémon copies the Ability of a defeated ally.', 'Reacciona copiando la habilidad de un aliado debilitado.'),
('Ultraimpulso', 'beast-boost', 'The Pokémon boosts its most proficient stat each time it knocks out a Pokémon.', 'Si el Pokémon derrota a un rival en ese turno, aumenta su característica más fuerte.'),
('Sistema Alfa', 'rks-system', 'Changes the Pokémon’s type to match the memory disc it holds.', 'Cambia su tipo según el disco que lleve instalado.'),
('Electrogénesis', 'electric-surge', 'Turns the ground into Electric Terrain when the Pokémon enters a battle.', 'Crea un campo eléctrico al entrar en combate.'),
