('Herbogénesis', 'grassy-surge', 'Turns the ground into Grassy Terrain when the Pokémon enters a battle.', 'Crea un campo de hierba al entrar en combate.'),
('Guardia Metálica', 'full-metal-body', 'Prevents other Pokémon’s moves or Abilities from lowering the Pokémon’s stats.', 'Evita que bajen sus características a causa de movimientos o habilidades de otros Pokémon.'),
('Guardia Espectro', 'shadow-shield', 'Reduces the amount of damage the Pokémon takes while its HP is full.', 'Reduce el daño sufrido si los PS están al máximo.'),
('Armadura Prisma', 'prism-armor', 'Reduces the power of supereffective attacks taken.', 'Mitiga el daño que le infligen los movimientos supereficaces.'),
('Fuerza Cerebral', 'neuroforce', 'Powers up moves that are super effective.', 'Potencia los ataques supereficaces.'),
('Espada Indómita', 'intrepid-sword', 'Boosts the Pokémon’s Attack stat when the Pokémon enters a battle.', 'Aumenta su Ataque al entrar en combate.'),
('Escudo Recio', 'dauntless-shield', 'Boosts the Pokémon’s Defense stat when the Pokémon enters a battle.', 'Aumenta su Defensa al entrar en combate.'),
('Líbero', 'libero', 'Changes the Pokémon’s type to the type of the move it’s about to use.', 'Cambia su tipo al del movimiento que va a usar.'),
('Recogebolas', 'ball-fetch', 'If the Pokémon is not holding an item, it will fetch the Poké Ball from the first failed throw of the battle.', 'Si no lleva equipado ningún objeto, recupera la Poké Ball del primer intento de captura fallido.'),
('Pelusa', 'cotton-down', 'When the Pokémon is hit by an attack, it scatters cotton fluff around and lowers the Speed stat of all Pokémon except itself.', 'Al ser alcanzado por un ataque, suelta una pelusa de algodón que reduce la Velocidad de todos los demás Pokémon.'),
('Hélice Caudal', 'propeller-tail', 'Ignores the effects of opposing Pokémon’s Abilities and moves that draw in moves.', 'Impide que el rival pueda atraer ataques hacia sí mismo por efecto de su habilidad o sus movimientos.'),
