('Tragamisil', 'gulp-missile', 'When the Pokémon uses Surf or Dive, it will come back with prey. When it takes damage, it will spit out the prey to attack.', 'Tras usar Surf o Buceo, emerge con una presa en la boca. Al recibir daño, ataca escupiéndola al rival.'),
('Acérrimo', 'stalwart', 'Ignores the effects of opposing Pokémon’s Abilities and moves that draw in moves.', 'Impide que el rival pueda atraer ataques hacia sí mismo por efecto de su habilidad o sus movimientos.'),
('Combustible', 'steam-engine', 'Boosts the Pokémon’s Speed stat drastically if hit by a Fire- or Water-type move.', 'Si le alcanza un movimiento de tipo Fuego o Agua, le sube muchísimo la Velocidad.'),
('Punk Rock', 'punk-rock', 'Boosts the power of sound-based moves. The Pokémon also takes half the damage from these kinds of moves.', 'Potencia los movimientos que usan sonido y reduce a la mitad el daño que le infligen dichos movimientos.'),
('Expulsarena', 'sand-spit', 'The Pokémon creates a sandstorm when it’s hit by an attack.', 'Provoca una tormenta de arena al recibir un ataque.'),
('Escama de Hielo', 'ice-scales', 'The Pokémon is protected by ice scales, which halve the damage taken from special moves.', 'Las gélidas escamas que protegen su cuerpo reducen a la mitad el daño que le infligen los ataques especiales.'),
('Maduración', 'ripen', 'Ripens Berries and doubles their effect.', 'Hace madurar las bayas, por lo que duplica sus efectos.'),
('Cara de Hielo', 'ice-face', 'The Pokémon’s ice head can take a physical attack as a substitute, but the attack also changes the Pokémon’s appearance. The ice will be restored when it hails.', 'Absorbe el daño de un ataque físico con el hielo de la cabeza, tras lo cual cambia de forma. El hielo se regenerará la próxima vez que granice.'),
