('Alma Acerada', 'steely-spirit', 'Powers up ally Pokémon’s Steel-type moves.', 'Potencia los movimientos de tipo Acero de los aliados.'),
('Cuerpo Mortal', 'perish-body', 'When hit by a move that makes direct contact, the Pokémon and the attacker will faint after three turns unless they switch out of battle.', 'Si le alcanza un movimiento de contacto, se debilitará al cabo de 3 turnos, así como su agresor, a menos que abandonen el terreno de combate.'),
