('Puño Invisible', 'unseen-fist', 'If the Pokémon uses moves that make direct contact, it can attack the target even if the target protects itself.', 'Si usa un movimiento de contacto, puede infligir daño al objetivo aunque este se proteja.'),
('Medicina Extraña', 'curious-medicine', 'When the Pokémon enters a battle, it scatters medicine from its shell, which removes all stat changes from allies.', 'Al entrar en combate, rezuma una substancia medicinal por la caracola que revierte los cambios en las características de los aliados.'),
