('Pulsera Z', 'Z-Ring', 'A mysterious ring that enables Pokémon to use Z-Power. It requires both the willpower and the physical power of the Trainer wearing it.', 'Misteriosa pulsera que transmite la fuerza física y mental del Entrenador a sus Pokémon, lo que les permite usar movimientos Z.', false),
('Dueyestal Z', 'Decidium Z', 'This is a crystallized form of Z-Power. It upgrades Decidueye’s Spirit Shackle to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Puntada Sombría de Decidueye.', false),
('Incinostal Z', 'Incinium Z', 'This is a crystallized form of Z-Power. It upgrades Incineroar’s Darkest Lariat to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Lariat Oscuro de Incineroar.', false),
('Primastal Z', 'Primarium Z', 'This is a crystallized form of Z-Power. It upgrades Primarina’s Sparkling Aria to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Aria Burbuja de Primarina.', false),
('Tapistal Z', 'Tapunium Z', 'This is a crystallized form of Z-Power. It upgrades the tapu’s Nature’s Madness to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Furia Natural de los Tapu.', false),
('Marshastal Z', 'Marshadium Z', 'This is a crystallized form of Z-Power. It upgrades Marshadow’s Spectral Thief to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Robasombra de Marshadow.', false),
('Alo-Raistal Z', 'Aloraichium Z', 'This is a crystallized form of Z-Power. It upgrades Alolan Raichu’s Thunderbolt to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Rayo de los Raichu de Alola.', false),
('Snorlastal Z', 'Snorlium Z', 'This is a crystallized form of Z-Power. It upgrades Snorlax’s Giga Impact to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Giga Impacto de Snorlax.', false),
('Eeveestal Z', 'Eevium Z', 'This is a crystallized form of Z-Power. It upgrades Eevee’s Last Resort to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Última Baza de Eevee.', false),
('Mewstal Z', 'Mewnium Z', 'This is a crystallized form of Z-Power. It upgrades Mew’s Psychic to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Psíquico de Mew.', false),
('Ash-Pikastal Z', 'Pikashunium Z', 'This is a crystallized form of Z-Power. It upgrades a Thunderbolt by Pikachu in a cap to a Z-Move.', 'Cristal que confiere el Poder Z al movimiento Rayo de los Pikachu que llevan gorra.', false),
('Zurrón', 'Forage Bag', 'A bag to carry ingredients gathered during Mallow’s trial in the jungle.', 'Saco para guardar ingredientes, indispensable en la Jungla Umbría para superar la prueba de Lulú.', false),
('Caña', 'Fishing Rod', 'A Fishing Rod made by Captain Lana. Cast a line over piles of underwater rocks to fish for wild aquatic Pokémon.', 'Caña fabricada por la Capitana Nereida. Permite pescar los Pokémon escondidos en las rocas sumergidas.', false),
('Máscara Profesor', 'Professor’s Mask', 'The mask that belongs to The Masked Royal.  This pro wrestler apparently sews his mask on a machine himself.', 'La máscara de luchador de Royale, el Enmascarado. Muy probablemente de factura propia.', false),
('Festicupón', 'Festival Ticket', 'A ticket that allows you to host a mission in Festival Plaza.', 'Se puede canjear para organizar minijuegos en la Festi Plaza.', false),
('Piedra Brillante', 'Sparkling Stone', 'A stone entrusted by a Pokémon that has been venerated as a guardian deity in the Alola region. There is said to be some secret in how it sparkles.', 'Piedra con un misterioso brillo entregada por un Pokémon considerado como uno de los espíritus guardianes de Alola.', false),
('Nerviosfera', 'Adrenaline Orb', 'Using it makes wild Pokémon more likely to call for help. If held by a Pokémon, it boosts Speed when intimidated. It can be used only once.', 'Aumenta la Velocidad del portador al sufrir Intimidación. Si se usa, hará más probable que el Pokémon rival pida ayuda. Desaparece tras usarla.', false),
('Arca de Zygarde', 'Zygarde Cube', 'An item to store Zygarde Cores and Cells. You can also use it to teach Zygarde moves.', 'Dispositivo para almacenar células y núcleos de Zygarde. También es posible usarlo para enseñarle movimientos.', false),
('Piedra Hielo', 'Ice Stone', 'A peculiar stone that can make certain species of Pokémon evolve. It has an unmistakable snowflake pattern.', 'Una piedra peculiar que hace evolucionar a algunos Pokémon. Presenta motivos que recuerdan a los cristales de hielo.', false),
('Buscamontura', 'Ride Pager', 'By entering certain numbers on this pager, you can summon Ride Pokémon in an instant.', 'Dispositivo dotado de un teclado numérico con el que llamar a diversas Pokémonturas.', false),
('Ente Ball', 'Beast Ball', 'A special Poké Ball designed to catch Ultra Beasts. It has a low success rate for catching others.', 'Un tipo especial de Poké Ball diseñada para capturar de forma específica y exclusiva a los misteriosos seres conocidos como Ultraentes.', false),
('Malasada Maxi', 'Big Malasada', 'The Alola region’s local specialty—fried bread. It can be used once to heal all the status conditions of a Pokémon.', 'Fritura típica de Alola que cura todos los problemas de estado de un Pokémon.', false),
('Néctar Rojo', 'Red Nectar', 'A flower nectar obtained at Ula’ula Meadow. It changes the form of certain species of Pokémon.', 'Néctar de ciertas flores de los Jardines de Ula-Ula, capaz de hacer cambiar de forma a una determinada especie de Pokémon.', false),
('Néctar Amarillo', 'Yellow Nectar', 'A flower nectar obtained at Melemele Meadow. It changes the form of certain species of Pokémon.', 'Néctar de ciertas flores de los Jardines de Melemele, capaz de hacer cambiar de forma a una determinada especie de Pokémon.', false),
('Néctar Rosa', 'Pink Nectar', 'The flower nectar obtained at the flowering shrubs on Royal Avenue. It changes the form of certain species of Pokémon.', 'Néctar de ciertas flores de los parterres de la Avenida Royale, capaz de hacer cambiar de forma a una determinada especie de Pokémon.', false),
('Néctar Violeta', 'Purple Nectar', 'A flower nectar obtained at Poni Meadow. It changes the form of certain species of Pokémon.', 'Néctar de ciertas flores de los Jardines de Poni, capaz de hacer cambiar de forma a una determinada especie de Pokémon.', false),
('Flauta Solar', 'Sun Flute', 'It is said that the tones it produces were offered up as an expression of gratitude to the Legendary Pokémon of the sun.', 'Flauta que se hace sonar como muestra de gratitud hacia el Pokémon legendario del sol.', false),
('Flauta Lunar', 'Moon Flute', 'It is said that the tones it produces were offered up as an expression of gratitude to the Legendary Pokémon of the moon.', 'Flauta que se hace sonar como muestra de gratitud hacia el Pokémon legendario de la luna.', false),
('Nota Intrigante', 'Enigmatic Card', 'A mysterious card. Written on it is a request for you to go to a guest room in an Akala motel on Route 8.', 'Misteriosa nota que reza: “Te espero en una habitación del motel de la Ruta 8 en Akala”.', false),
('Cubresuelos', 'Terrain Extender', 'An item to be held by a Pokémon. It extends the duration of the terrain caused by the holder’s move or Ability.', 'Al llevarlo, prolonga la duración de los campos creados por el Pokémon en el terreno de combate mediante movimientos o su habilidad.', false),
('Paracontacto', 'Protective Pads', 'An item to be held by a Pokémon. These pads protect the holder from effects caused by making direct contact with the target.', 'Protege al Pokémon de los efectos que le produciría el contacto directo en combate.', false),
('Semilla Electro', 'Electric Seed', 'An item to be held by a Pokémon. It boosts Defense on Electric Terrain. It can only be used once.', 'Aumenta la Defensa del portador si se usa cuando el terreno está cubierto por un campo eléctrico.', false),
