('Semilla Bruma', 'Misty Seed', 'An item to be held by a Pokémon. It boosts Sp. Def on Misty Terrain. It can only be used once.', 'Aumenta la Defensa Especial del portador si se usa cuando el terreno está cubierto por un campo de niebla.', false),
