('Pétalo Rosa', 'Pink Petal', 'A pressed flower petal you receive from Mina during Mina’s trial. The goal is to collect seven different kinds of petals.', 'Pétalo prensado recibido de manos de Rika durante su prueba. El objetivo es reunir siete distintos.', false),
