('Flor Irisada', 'Rainbow Flower', 'A flower made of the petals you received from captains. It’s proof that your growth has been recognized by them.', 'Flor resultante de la unión de los siete pétalos entregados por los Capitanes, símbolo de la experiencia y madurez acumuladas en tu aventura.', false),
('Medalla Fulgor', 'Surge Badge', 'A novelty badge that you can receive at the Kantonian Gym. Rumor has it that it imitates the Badge of a Gym somewhere.', 'Medalla conseguida en el Gimnasio de Kanto. Su aspecto guarda un sospechoso parecido con la medalla de otro Gimnasio.', false),
('Necrosol', 'N-Solarizer', 'A machine to fuse Necrozma, which needs light, and Solgaleo.', 'Artefacto que permite fusionar a Necrozma, ávido de luz, con Solgaleo.', false),
('Necroluna', 'N-Lunarizer', 'A machine to fuse Necrozma, which needs light, and Lunala.', 'Artefacto que permite fusionar a Necrozma, ávido de luz, con Lunala.', false),
('Necrosol', 'N-Solarizer', 'A machine to separate Necrozma, which needed light, from Solgaleo.', 'Artefacto que permite separar a Necrozma, ávido de luz, tras su fusión con Solgaleo.', false),
('Necroluna', 'N-Lunarizer', 'A machine to separate Necrozma, which needed light, from Lunala.', 'Artefacto que permite separar a Necrozma, ávido de luz, tras su fusión con Lunala.', false),
('Cristal Z (Liam)', 'Ilima Normalium Z', 'The Normalium Z you were entrusted with by Ilima. You were asked to place it on the pedestal at the back of Verdant Cavern.', 'Normastal Z que te entrega Liam para que lo deposites sobre el altar situado al fondo de la Cueva Sotobosque.', false),
('Poké Ball Ajena', 'Left Poké Ball', 'A Poké Ball with a Pokémon that lost its Trainer inside. It seems to be from Ula’ula Island.', 'Poké Ball que alberga un Pokémon que perdió a su Entrenador, al parecer, natural de Ula-Ula.', false),
('Cupón Eclosión', 'Roto Hatch', 'One of the Rotom Powers. It helps Eggs hatch faster.', 'Poder Rotom que hace que los Huevos eclosionen mucho antes.', false),
('Cupón Rebaja', 'Roto Bargain', 'One of the Rotom Powers. It reduces the prices of products at Poké Marts by half.', 'Poder Rotom que reduce a la mitad el coste de los artículos en las Tiendas Pokémon.', false),
('Cupón Botín', 'Roto Prize Money', 'One of the Rotom Powers. It triples the prize money you receive after battle.', 'Poder Rotom que triplica las ganancias obtenidas en combate.', false),
('Cupón Exp', 'Roto Exp. Points', 'One of the Rotom Powers. It increases the Exp. Points your Pokémon receive after battle a little.', 'Poder Rotom que incrementa ligeramente los Puntos de Experiencia obtenidos en combate.', false),
('Cupón Amistad', 'Roto Friendship', 'One of the Rotom Powers. It helps Pokémon in your party grow friendly faster.', 'Poder Rotom que hace que el grado de amistad de los Pokémon de tu equipo aumente más rápido.', false),
('Cupón Reclamo', 'Roto Encounter', 'One of the Rotom Powers. It increases the chance of encountering high-level wild Pokémon a lot for a certain period of time.', 'Poder Rotom que aumenta la probabilidad de encontrar Pokémon salvajes de nivel alto durante un tiempo determinado.', false),
('Cupón Sigilo', 'Roto Stealth', 'One of the Rotom Powers. It prevents you from encountering wild Pokémon for a certain period of time.', 'Poder Rotom que permite evitar por completo los encuentros con Pokémon salvajes durante un tiempo determinado.', false),
('Cupón PS', 'Roto HP Restore', 'One of the Rotom Powers. It fully restores the HP of your battling Pokémon.', 'Poder Rotom que restaura todos los PS de los Pokémon de tu equipo que estén combatiendo.', false),
('Cupón PP', 'Roto PP Restore', 'One of the Rotom Powers. It fully restores the PP of your battling Pokémon.', 'Poder Rotom que restaura todos los PP de los Pokémon de tu equipo que estén combatiendo.', false),
('Cupón Refuerzo', 'Roto Boost', 'One of the Rotom Powers. It raises all stats of your battling Pokémon.', 'Poder Rotom que hace aumentar las características de los Pokémon de tu equipo que estén combatiendo.', false),
('Cupón Captura', 'Roto Catch', 'One of the Rotom Powers. It increases the chance to catch Pokémon a lot.', 'Poder Rotom que aumenta mucho la probabilidad de capturar al Pokémon salvaje al que te estés enfrentando.', false),
('Autógrafo', 'Autograph', 'The autograph you got from the Vermilion City Gym Leader, Lt. Surge. He wrote, “Good luck!”', 'El autógrafo del Teniente Surge, el Líder de Gimnasio de Ciudad Carmín. La dedicatoria reza: "Good luck!".', false),
('Baya Frambu Plateada', 'Silver Razz Berry', 'A Berry that makes it easier to catch Pokémon when given to them.', 'Una baya que puedes lanzar a un Pokémon salvaje para que resulte bastante más fácil capturarlo.', false),
('Baya Frambu Dorada', 'Golden Razz Berry', 'A Berry that makes it drastically easier to catch Pokémon when given to them.', 'Una baya que puedes lanzar a un Pokémon salvaje para que resulte mucho más fácil capturarlo.', false),
('Baya Latano Plateada', 'Silver Nanab Berry', 'A Berry that calms wild Pokémon you’re trying to catch when given to them.', 'Una baya que puedes lanzar a un Pokémon salvaje para tranquilizarlo bastante.', false),
('Baya Latano Dorada', 'Golden Nanab Berry', 'A Berry that calms wild Pokémon you’re trying to catch drastically when given to them.', 'Una baya que puedes lanzar a un Pokémon salvaje para tranquilizarlo mucho.', false),
('Baya Pinia Plateada', 'Silver Pinap Berry', 'A Berry that makes you more likely to get an item when given to Pokémon you’re trying to catch.', 'Una baya que puedes lanzar a un Pokémon salvaje para aumentar bastante las probabilidades de conseguir un objeto tras capturarlo.', false),
('Baya Pinia Dorada', 'Golden Pinap Berry', 'A Berry that makes you drastically more likely to get an item when given to Pokémon you’re trying to catch.', 'Una baya que puedes lanzar a un Pokémon salvaje para aumentar mucho las probabilidades de conseguir un objeto tras capturarlo.', false),
('Llave Secreta', 'Secret Key', 'The key that unlocks the front door of the Pokémon Gym on Cinnabar Island. It has a red decoration.', 'Llave que abre las puertas del Gimnasio de Isla Canela. En su diseño predomina el color rojo.', false),
('Ticket del Barco', 'S.S. Ticket', 'The ticket required to board the S.S. Anne. It has a drawing of a ship on it.', 'Billete necesario para embarcar en el S. S. Anne. Tiene dibujado un barco.', false),
('Paquete', 'Parcel', 'A parcel to be delivered to Professor Oak from Viridian City’s Poké Mart.', 'Un paquete para el Profesor Oak que te entregaron en la Tienda Pokémon de Ciudad Verde.', false),
