('Bola de Arcilla', 'Polished Mud Ball', 'A ball made of mud. It had been polished for such a long time that the surface is very shiny.', 'Bola de barro que ha sido pulida durante tanto tiempo que su superficie ha quedado lisa y brillante.', false),
('Concha Tropical', 'Tropical Shell', 'A beautiful white shell that may have drifted from a sea in a warm region.', 'Preciosa concha de color blanco que quizá haya sido arrastrada por las corrientes marinas desde mares de regiones más cálidas.', false),
('Hoja Escrita', 'Leaf Letter', 'A letter written on a leaf. Something is written using Pikachu’s footprints.', 'Una carta escrita en una hoja. Hay huellas de Pikachu estampadas en ella y parecen guardar algún significado.', false),
('Hoja Escrita', 'Leaf Letter', 'A letter written on a leaf. Something is written using Eevee’s footprints.', 'Una carta escrita en una hoja. Hay huellas de Eevee estampadas en ella y parecen guardar algún significado.', false),
('Ramo Pequeño', 'Small Bouquet', 'A small bouquet that was made with heart and soul for a single Trainer.', 'Pequeño ramo de flores confeccionado con dedicación y esmero solo para ti.', false),
('Colonia', 'Lure', 'A glass bottle of perfume that makes rare Pokémon more likely to appear.', 'Colonia que atrae a los Pokémon raros durante un breve espacio de tiempo.', false),
