('Caja de Pokémon', 'Pokémon Box Link', 'A device that allows you to access the Pokémon storage system. There are some places where it won’t work.', 'Permite acceder en todo momento a tus Cajas del PC de los Centros Pokémon para dejar o sacar Pokémon.', false),
('Estrella Deseo', 'Wishing Star', 'A stone found in the Galar region with a mysterious power. It’s said that your dreams come true if you find one.', 'Piedra de poder misterioso hallada en la región de Galar. Se dice que quien encuentra una verá realizados sus sueños.', false),
('Maximuñequera', 'Dynamax Band', 'A Wishing Star has been affixed to it. It lets out a light that allows Pokémon to Dynamax when at a Power Spot.', 'Si lleva engarzada una Estrella Deseo y el portador se halla junto a un nodo energético, reacciona emitiendo una luz y permite dinamaxizar Pokémon.', false),
('Caña', 'Fishing Rod', 'Use it by the water to fish up various kinds of Pokémon.', 'Sirve para pescar Pokémon salvajes en todo tipo de cuerpos de agua.', false),
('Bici Rotom', 'Rotom Bike', 'This bike can be combined with the Pokémon Rotom to use a turbo boost.', 'Una bicicleta en la que puede activarse el turbo, al llevar al Pokémon Rotom incorporado en el motor.', false),
('Salchichas', 'Sausages', 'One of the many ingredients that can be used for cooking at your camp. These sausages should be boiled before eating.', 'Un ingrediente para cocinar en el campamento. Si te apetece disfrutar de su delicioso sabor, basta con hervirlas.', false),
('Lata de Darren', 'Bob’s Food Tin', 'One of the many ingredients that can be used for cooking at your camp. The tinned food that Bob sells is curiously popular in Galar.', 'Un ingrediente para cocinar en el campamento. Las conservas de Darren son muy apreciadas por todo Galar.', false),
('Lata de Bach', 'Bach’s Food Tin', 'One of the many ingredients that can be used for cooking at your camp. The tinned food that Bach sells is curiously popular in Galar.', 'Un ingrediente para cocinar en el campamento. Las conservas de Bach son muy apreciadas por todo Galar.', false),
('Lata de Habas', 'Tin of Beans', 'One of the many ingredients that can be used for cooking at your camp. When simmered, the beans suffuse a dish with their mild flavor.', 'Un ingrediente para cocinar en el campamento. Al estofar las habas en la salsa, esta absorbe parte de su dulzor.', false),
('Pan de Molde', 'Bread', 'One of the many ingredients that can be used for cooking at your camp. An indispensable tool for mopping up that extra curry left on your plate.', 'Un ingrediente para cocinar en el campamento. No hay placer mayor que usar el pan para rebañar la salsa que queda en el plato.', false),
('Pasta', 'Pasta', 'One of the many ingredients that can be used for cooking at your camp. These flour noodles make for a surprisingly good match with curry.', 'Un ingrediente para cocinar en el campamento. Estos fideos de harina de trigo combinan inesperadamente bien con el curri.', false),
('Setas', 'Mixed Mushrooms', 'One of the many ingredients that can be used for cooking at your camp. The chewy texture of the mushrooms transforms any dish they’re added to.', 'Un ingrediente para cocinar en el campamento. Los distintos tipos de setas aportan diferentes texturas al curri.', false),
('Cola Ahumada', 'Smoke-Poke Tail', 'One of the many ingredients that can be used for cooking at your camp. When a Slowpoke’s tail falls off, it grows back quickly.', 'Un ingrediente para cocinar en el campamento. Las colas de Slowpoke siempre vuelven a crecer al poco de desprenderse.', false),
('Puerro Grueso', 'Large Leek', 'One of the many ingredients that can be used for cooking at your camp. Whether this is the kind of vegetable stalk that Farfetch’d like is unknown.', 'Un ingrediente para cocinar en el campamento. No se sabe si este es el tipo de verdura que le gusta a Farfetch’d.', false),
('Manzana Selecta', 'Fancy Apple', 'One of the many ingredients that can be used for cooking at your camp. An apple chosen above others. It has spectacular form and a brilliant sheen.', 'Un ingrediente para cocinar en el campamento. Es brillante y tiene una forma perfecta.', false),
('Huesos Finos', 'Brittle Bones', 'One of the many ingredients that can be used for cooking at your camp. The taste boiled off from the bones is sure to give a dish a light umami taste.', 'Un ingrediente para cocinar en el campamento. Los jugos del hueso dan un profundo sabor a la salsa.', false),
('Patatas', 'Pack of Potatoes', 'One of the many ingredients that can be used for cooking at your camp. Potatoes help mellow out a spicy taste, to make a dish more mild.', 'Un ingrediente para cocinar en el campamento. Las patatas contrarrestan el picante y suavizan el plato.', false),
('Hierba Intensa', 'Pungent Root', 'One of the many ingredients that can be used for cooking at your camp. Though carelessly picked, these herbs can add a fragrant accent to a dish.', 'Un ingrediente para cocinar en el campamento. Unas hierbas que aportan color y aroma a la salsa.', false),
('Verduras', 'Salad Mix', 'One of the many ingredients that can be used for cooking at your camp. The assortment of vegetables looks quite appealing and healthy.', 'Un ingrediente para cocinar en el campamento. Una mezcla muy sana de varios tipos de verduras.', false),
('Frituras', 'Fried Food', 'One of the many ingredients that can be used for cooking at your camp. It’s been a while since it was fried, so it’s gotten greasy.', 'Un ingrediente para cocinar en el campamento. A medida que pasa el tiempo se van volviendo más aceitosas.', false),
('Huevo Duro', 'Boiled Egg', 'One of the many ingredients that can be used for cooking at your camp. Even just one boiled egg can really enhance a dish.', 'Un ingrediente para cocinar en el campamento. Con tan solo uno de estos huevos se consigue un plato gourmet.', false),
('Kit de Acampada', 'Camping Gear', 'Everything you need to set up a tent and get cooking in a Wild Area or at a camping spot.', 'Este kit tiene todo lo necesario para montar una tienda de campaña y cocinar, ya sea en el Área Silvestre o en zonas de acampada.', false),
('Espada Oxidada', 'Rusted Sword', 'It is said that a hero used this sword to halt a terrible disaster in ancient times. But it’s grown rusty and worn.', 'Cuenta una antigua leyenda que un valiente héroe blandió esta espada para hacer frente a un cataclismo, pero ahora está oxidada y en un estado lamentable.', false),
('Escudo Oxidado', 'Rusted Shield', 'It is said that a hero used this shield to halt a terrible disaster in ancient times. But it’s grown rusty and worn.', 'Cuenta una antigua leyenda que un valiente héroe asió este escudo para hacer frente a un cataclismo, pero ahora está oxidado y en un estado lamentable.', false),
('Ornitofósil', 'Fossilized Bird', 'The fossil of an ancient Pokémon that once soared through the sky. What it looked like is a mystery.', 'Parte del fósil de un Pokémon prehistórico que surcaba los cielos. Su apariencia sigue siendo una incógnita.', false),
('Ictiofósil', 'Fossilized Fish', 'The fossil of an ancient Pokémon that once lived in the sea. What it looked like is a mystery.', 'Parte del fósil de un Pokémon prehistórico que habitaba en el mar. Su apariencia sigue siendo una incógnita.', false),
('Dracofósil', 'Fossilized Drake', 'The fossil of an ancient Pokémon that once roamed the land. What it looked like is a mystery.', 'Parte del fósil de un Pokémon prehistórico que habitaba en tierra firme. Su aspecto sigue siendo una incógnita.', false),
('Plesiofósil', 'Fossilized Dino', 'The fossil of an ancient Pokémon that once lived in the sea. What it looked like is a mystery.', 'Parte del fósil de un Pokémon prehistórico que habitaba en el mar. Su apariencia sigue siendo una incógnita.', false),
('Confite Fresa', 'Strawberry Sweet', 'A strawberry-shaped sweet. When a Milcery holds this, it will spin around happily.', 'Figura de caramelo con forma de fresa. Al dárselo a Milcery, se pone a girar rebosante de alegría.', false),
('Confite Corazón', 'Love Sweet', 'A heart-shaped sweet. When a Milcery holds this, it spins around happily.', 'Figura de caramelo con forma de corazón. Al dárselo a Milcery, se pone a girar rebosante de alegría.', false),
('Confite Fruto', 'Berry Sweet', 'A berry-shaped sweet. When a Milcery holds this, it spins around happily.', 'Figura de caramelo con forma de baya. Al dárselo a Milcery, se pone a girar rebosante de alegría.', false),
('Confite Trébol', 'Clover Sweet', 'A clover-shaped sweet. When a Milcery holds this, it spins around happily.', 'Figura de caramelo con forma de trébol. Al dárselo a Milcery, se pone a girar rebosante de alegría.', false),
('Confite Flor', 'Flower Sweet', 'A flower-shaped sweet. When a Milcery holds this, it spins around happily.', 'Figura de caramelo con forma de flor. Al dárselo a Milcery, se pone a girar rebosante de alegría.', false),
('Confite Estrella', 'Star Sweet', 'A star-shaped sweet. When a Milcery holds this, it spins around happily.', 'Figura de caramelo con forma de estrella. Al dárselo a Milcery, se pone a girar rebosante de alegría.', false),
('Confite Lazo', 'Ribbon Sweet', 'A ribbon-shaped sweet. When a Milcery holds this, it spins around happily.', 'Figura de caramelo con forma de lazo. Al dárselo a Milcery, se pone a girar rebosante de alegría.', false),
('Manzana Dulce', 'Sweet Apple', 'A peculiar apple that can make a certain species of Pokémon evolve. It’s exceptionally sweet.', 'Curiosa manzana, de sabor particularmente dulce, que hace evolucionar a determinadas especies de Pokémon.', false),
('Manzana Ácida', 'Tart Apple', 'A peculiar apple that can make a certain species of Pokémon evolve. It’s exceptionally tart.', 'Curiosa manzana, de sabor particularmente ácido, que hace evolucionar a determinadas especies de Pokémon.', false),
('Espray Bucal', 'Throat Spray', 'Raises Sp. Atk when a Pokémon uses a sound-based move.', 'Aumenta el Ataque Especial al emplear un movimiento que se sirva del sonido.', false),
('Mochila Escape', 'Eject Pack', 'An item to be held by a Pokémon. When the holder’s stats are lowered, it will be switched out of battle.', 'Si el portador ve reducidas sus características, será sustituido por otro Pokémon del equipo.', false),
('Botas Gruesas', 'Heavy-Duty Boots', 'These boots prevent the effects of traps set on the battlefield.', 'Anula los efectos de aquello que se coloca a los pies del Pokémon para obstaculizarlo, como las trampas.', false),
('Seguro Fallo', 'Blunder Policy', 'Raises Speed sharply when a Pokémon misses with a move because of accuracy.', 'Aumenta mucho la Velocidad cuando el Pokémon yerra el movimiento debido a la precisión.', false),
('Servicio Raro', 'Room Service', 'An item to be held by a Pokémon. Lowers Speed when Trick Room takes effect.', 'Si lo lleva un Pokémon, reduce la Velocidad cuando se usa Espacio Raro.', false),
('Parasol Multiuso', 'Utility Umbrella', 'An item to be held by a Pokémon. This sturdy umbrella protects the holder from the effects of rain and harsh sunlight.', 'El portador se vuelve invulnerable a los efectos de la lluvia y del sol.', false),
('Caramelo Exp. XS', 'Exp. Candy XS', 'A candy that is packed with energy. When consumed, it will grant a single Pokémon a very small amount of Exp. Points.', 'Caramelo energético que aumenta ligerísimamente los Puntos de Experiencia de un Pokémon.', false),
('Caramelo Exp. S', 'Exp. Candy S', 'A candy that is packed with energy. When consumed, it will grant a single Pokémon a small amount of Exp. Points.', 'Caramelo energético que aumenta ligeramente los Puntos de Experiencia de un Pokémon.', false),
('Caramelo Exp. M', 'Exp. Candy M', 'A candy that is packed with energy. When consumed, it will grant a single Pokémon a moderate amount of Exp. Points.', 'Caramelo energético que aumenta los Puntos de Experiencia de un Pokémon.', false),
('Caramelo Exp. L', 'Exp. Candy L', 'A candy that is packed with energy. When consumed, it will grant a single Pokémon a large amount of Exp. Points.', 'Caramelo energético que aumenta bastante los Puntos de Experiencia de un Pokémon.', false),
('Caramelo Exp. XL', 'Exp. Candy XL', 'A candy that is packed with energy. When consumed, it will grant a single Pokémon a very large amount of Exp. Points.', 'Caramelo energético que aumenta mucho los Puntos de Experiencia de un Pokémon.', false),
('Caramelo Dinamax', 'Dynamax Candy', 'A candy that is packed with energy. When consumed, it will raise the Dynamax Level of a single Pokémon by one. A higher level means higher HP when Dynamaxed.', 'Caramelo energético que sube el nivel Dinamax de un Pokémon. Cuanto más alto sea el nivel, más aumentarán sus PS al dinamaxizarse.', false),
