('Menta Ingenua', 'Naive Mint', 'When a Pokémon smells this mint, its Speed will grow more easily, but its Sp. Def will grow more slowly.', 'Cuando un Pokémon percibe su aroma, aumenta con más facilidad su Velocidad, en detrimento de su Defensa Especial.', false),
