('Trozo Deseo', 'Wishing Piece', 'Throw one into a Pokémon Den to attract a wild Dynamax Pokémon.', 'Al lanzarlo en un nido Pokémon, aparece un Pokémon Dinamax.', false),
('Tetera Agrietada', 'Cracked Pot', 'A peculiar teapot that can make a certain species of Pokémon evolve. It may be cracked, but tea poured from it is delicious.', 'Curiosa tetera que hace evolucionar a determinadas especies de Pokémon. Pese a estar agrietada, sirve un té exquisito.', false),
('Tetera Rota', 'Chipped Pot', 'A peculiar teapot that can make a certain species of Pokémon evolve. It may be chipped, but tea poured from it is delicious.', 'Curiosa tetera que hace evolucionar a determinadas especies de Pokémon. Pese a estar rota, sirve un té exquisito.', false),
('Supertapones', 'Hi-tech Earbuds', 'Strange earbuds that allow you to freely control the volume of various sounds.', 'Curiosos auriculares que permiten ajustar de forma independiente el volumen de distintos elementos sonoros.', false),
('Fruta Tropical', 'Fruit Bunch', 'One of the many ingredients that can be used for cooking at your camp. The syrupy fruits give off a strong tropical feel.', 'Un ingrediente para cocinar en el campamento. La jugosa fruta aporta un toque tropical al plato.', false),
('Queso Mu-mu', 'Moomoo Cheese', 'One of the many ingredients that can be used for cooking at your camp. Melted cheese can really give a curry some richness.', 'Un ingrediente para cocinar en el campamento. El queso derretido aporta intensidad a la salsa.', false),
('Especias', 'Spice Mix', 'One of the many ingredients that can be used for cooking at your camp. There are over fifty spices contained within this ingredient’s hot flavor.', 'Un ingrediente para cocinar en el campamento. Es una mezcla picante de más de 50 tipos de especias.', false),
('Nata Fresca', 'Fresh Cream', 'One of the many ingredients that can be used for cooking at your camp. Add some whipped cream to a spicy curry to give it some sweetness.', 'Un ingrediente para cocinar en el campamento. La nata da un toque dulce a la salsa picante del curri.', false),
('Curri de Bote', 'Packaged Curry', 'One of the many ingredients that can be used for cooking at your camp. Using packaged curry helps make sure there are no slipups when cooking.', 'Un ingrediente para cocinar en el campamento. Este curri precocinado nunca falla.', false),
('Leche de Coco', 'Coconut Milk', 'One of the many ingredients that can be used for cooking at your camp. The refined sweetness of this coconut milk makes it quite popular.', 'Un ingrediente para cocinar en el campamento. Muy popular por el dulzor refinado que aporta al plato.', false),
('Fideos de Bote', 'Instant Noodles', 'One of the many ingredients that can be used for cooking at your camp. It has a junk-food sort of taste, but it goes well with curry.', 'Un ingrediente para cocinar en el campamento. El sabor reconfortante de estos fideos casa inesperadamente bien con la salsa de curri.', false),
('Hamburguesas', 'Precooked Burger', 'One of the many ingredients that can be used for cooking at your camp. If you’re unsure about what to cook, you can’t go wrong with some burger.', 'Un ingrediente para cocinar en el campamento. Una apuesta segura, perfecta para esos momentos de duda.', false),
('Especias Gigamax', 'Gigantamix', 'One of the many ingredients that can be used for cooking at your camp. A mysterious spice. Even a tiny sprinkle is sure to make a curry gigantic.', 'Un ingrediente para cocinar en el campamento. Una pizca de esta extraña especia basta para elaborar un curri gigantesco.', false),
('Trocito Deseo', 'Wishing Chip', 'Toss a number of them into a Pokémon Den for the chance to attract a wild Dynamax Pokémon.', 'Al lanzar unos cuantos a un nido Pokémon, es posible que aparezca algún Pokémon Dinamax.', false),
('Bici Rotom', 'Rotom Bike', 'This bike can be combined with the Pokémon Rotom to not only do a turbo boost but also run on the water.', 'Combinada con el Pokémon Rotom, esta bicicleta te permite usar un turbo y también desplazarte por encima del agua.', false),
('Amuleto Captura', 'Catching Charm', 'Holding it is said to increase the chance of getting a critical catch. Curiously, the charm doesn’t shake much.', 'Aumenta la probabilidad de lograr una captura crítica al llevarlo equipado. Curiosamente, apenas vibra.', false),
('Carta Ajada', 'Old Letter', 'A letter entrusted to you by a girl, to be delivered to a boy. Strangely, it looks old to you.', 'Carta de aspecto desgastado entregada por una niña y con un chico como destinatario.', false),
('Autógrafo Grupo', 'Band Autograph', 'It’s signed by all members of the Galar region’s most charismatic band, the Maximizers.', 'Un autógrafo firmado por todos los miembros de los Maximizers, el grupo musical más carismático de Galar.', false),
('Libro de Sonia', 'Sonia’s Book', 'Professor Sonia’s published writings. Her new discoveries about the Galar region’s legends are recorded in this enjoyable read.', 'Publicación de la Profesora Sonia que trata de forma amena los recientes descubrimientos sobre las leyendas de la región de Galar.', false),
('Catálogo Rotom', 'Rotom Catalog', 'A catalog of devices that Rotom like. Use the catalog to have Rotom hop in and out of the various devices listed within.', 'Un catálogo de los artilugios favoritos de Rotom que le permite introducirse o salir fácilmente de los mismos.', false),
('Maxipanal', 'Max Honey', 'Honey that Dynamax Vespiquen produces. Adding this honey to Max Soup makes the taste very smooth. It also has the same effect as a Max Revive.', 'Panal construido por Vespiquen Dinamax cuya densa miel suaviza el sabor de la Maxisopa. También tiene el mismo efecto que un Revivir Máximo.', false),
('Maxiseta', 'Max Mushrooms', 'Mushrooms that have the power of changing Dynamax forms. They boost all stats of a Pokémon during battle.', 'Una seta capaz de cambiar el aspecto de los Pokémon al dinamaxizarse. Aumenta todas las características de un Pokémon si se usa en combate.', false),
('Rama de Galanuez', 'Galarica Twig', 'A twig from a species of tree called Galarica that grows in certain areas around the Galar region. It’s a material for an accessory for a certain Pokémon.', 'Una rama de un árbol llamado Galanuez, que crece en determinadas zonas de Galar. Con ella se pueden crear accesorios para cierto Pokémon.', false),
('Brazal Galanuez', 'Galarica Cuff', 'A cuff made from woven-together Galarica Twigs. Giving it to Galarian Slowpoke makes the Pokémon very happy.', 'Un brazalete hecho de Ramas de Galanuez trenzadas. Los Slowpoke de Galar se ponen contentísimos si lo reciben como regalo.', false),
('Tarjeta Chic', 'Style Card', 'A card that increases the selection in boutiques and hair salons.', 'Una tarjeta que aumenta la selección de artículos disponibles en las tiendas y permite elegir entre una mayor variedad de peinados en las peluquerías.', false),
('Pase Armadura', 'Armor Pass', 'A pass to go to the Isle of Armor. Show it to the rail staff at Wedgehurst Station.', 'Un pase que permite viajar hasta la Isla de la Armadura. Hay que mostrárselo al empleado de la estación de Pueblo Par.', false),
('Bici Rotom', 'Rotom Bike', 'This bike can do a turbo boost and run on the water using Rotom’s power. It’s a sparkling white that shines brilliantly.', 'Gracias al poder de Rotom, esta bicicleta permite usar el turbo y desplazarse sobre el agua. Tiene un color blanco centelleante.', false),
('Bici Rotom', 'Rotom Bike', 'This bike can do a turbo boost and run on the water using Rotom’s power. It’s a glistening black that shines reddish-black.', 'Gracias al poder de Rotom, esta bicicleta permite usar el turbo y desplazarse sobre el agua. De color negro y con una fulgurante estela rojinegra.', false),
('Amuleto Exp', 'Exp. Charm', 'A charm that increases the Exp. Points that Pokémon can get. A machine-like object is inside the charm.', 'Amuleto que aumenta los Puntos de Experiencia que reciben los Pokémon. Su interior contiene una especie de mecanismo.', false),
('Duralium', 'Armorite Ore', 'Rare ore that can be obtained on the Isle of Armor. Something good will happen if you give it to a collector on the Isle of Armor.', 'Un mineral poco común que se encuentra en la Isla de la Armadura. Tal vez ocurra algo bueno al dárselo a un coleccionista de dicha isla.', false),
('Amuleto Emblema', 'Mark Charm', 'A mysterious and unique charm that increases the chance of finding a Pokémon with a mark.', 'Misterioso y particular amuleto que aumenta las posibilidades de encontrar Pokémon con emblemas.', false),
('Riendas Unión', 'Reins of Unity', 'Reins that people presented to the king. They enhance Calyrex’s power over bountiful harvests and unite Calyrex with its beloved steed.', 'Riendas que se entregaron como ofrenda al rey. Potencian los poderes de Calyrex para mejorar las cosechas y le permiten unirse con su amado corcel.', false),
('Riendas Unión', 'Reins of Unity', 'Reins that people presented to the king. They enable those who are connected to communicate with each other. The reins separate Calyrex and its beloved steed.', 'Riendas que se entregaron como ofrenda al rey. Permiten el entendimiento mutuo entre aquellos que están unidos y separan a Calyrex de su amado corcel.', false),
('Corona Galanuez', 'Galarica Wreath', 'A wreath made from woven-together Galarica Twigs. Placing it on the head of a Galarian Slowpoke makes the Pokémon very happy.', 'Una corona hecha de Ramas de Galanuez trenzadas. Los Slowpoke de Galar se ponen contentísimos cuando la llevan puesta.', false),
('Leyenda 1', 'Legendary Clue 1', 'A clue about the King of Bountiful Harvests. It’s written by Peony, and an old photo is attached to it.', 'Una nota escrita por Peony acerca de la leyenda del Rey de las Cosechas. Lleva adjunta una vieja fotografía.', false),
('Leyenda 2', 'Legendary Clue 2', 'A clue about the legend of giants. It’s written by Peony and has unique drawings.', 'Una nota escrita por Peony acerca de la leyenda de los gigantes. Contiene unas ilustraciones muy particulares.', false),
('Leyenda 3', 'Legendary Clue 3', 'A clue about the legend of bird Pokémon. It’s written by Peony and has a unique drawing.', 'Una nota escrita por Peony acerca de la leyenda de las aves legendarias. Contiene una ilustración muy particular.', false),
('Leyenda (?)', 'Legendary Clue?', 'A mysterious clue that Peony seems to have dropped. There’s a photo attached to it showing a shining hole opening above the Max Lair.', 'Una extraña nota que se le cayó a Peony. Tiene pegada una foto del Supernido Dinamax en la que se ve una cavidad luminosa.', false),
('Pase Corona', 'Crown Pass', 'A pass to go to the Crown Tundra. Show it to the rail staff at Wedgehurst Station.', 'Un pase que permite viajar hasta las Nieves de la Corona. Hay que mostrárselo al empleado de la estación de Pueblo Par.', false),
('Corona Tallada', 'Wooden Crown', 'A mysterious object made of wood. Part of it seems to be chipped. Maybe it’s meant to be part of something.', 'Un misterioso objeto hecho de madera. Las marcas que presenta parecen indicar que no está completo, como si formase parte de algo.', false),
('Pétalo Fulgor', 'Radiant Petal', 'A single petal that the King of Bountiful Harvests gave you. It radiates faint light.', 'Un pétalo recibido del Rey de las Cosechas. Emite una luz tenue.', false),
('Crin Blanca', 'White Mane Hair', 'Mane hair that belonged to the King of Bountiful Harvests’ beloved steed, Glastrier. The hair is strong and very flexible.', 'Parte de la crin de Glastrier, el amado corcel del Rey de las Cosechas. Es flexible y resistente.', false),
('Crin Negra', 'Black Mane Hair', 'Mane hair that belonged to the King of Bountiful Harvests’ beloved steed, Spectrier. The hair is very smooth to the touch.', 'Parte de la crin de Spectrier, el amado corcel del Rey de las Cosechas. Es suave al tacto.', false),
('Zanahoria Nívea', 'Iceroot Carrot', 'Produce that the King of Bountiful Harvests’ beloved steed likes to eat. It grew in a field covered in snow.', 'Una zanahoria cultivada en un huerto rebosante de nieve. Es la hortaliza preferida del amado corcel del Rey de las Cosechas.', false),
('Zanahoria Oscura', 'Shaderoot Carrot', 'Produce that the King of Bountiful Harvests’ beloved steed likes to eat. It grew in a gloomy field.', 'Una zanahoria cultivada en un huerto sombrío. Es la hortaliza preferida del amado corcel del Rey de las Cosechas.', false),
('Maxinium', 'Dynite Ore', 'Mysterious ore that can be obtained in the Max Lair. Something good will happen if you give it to a collector in the Crown Tundra.', 'Un extraño mineral que se encuentra en el Supernido Dinamax. Tal vez ocurra algo bueno al dárselo a un coleccionista de las Nieves de la Corona.', false),
('Sem. Zanahoria', 'Carrot Seeds', 'Seeds to plant in a field. The kind of carrot you’ll get is determined by which field you plant the seeds in.', 'Semillas para plantar en un huerto. Permiten obtener un tipo u otro de zanahoria en función del lugar elegido para su cultivo.', false),
('Parche Habilidad', 'Ability Patch', 'A patch that allows a Pokémon with a regular Ability to have a rare Ability.', 'Parche que permite cambiar la habilidad normal de un Pokémon a otra menos común.', false),
('Riendas Unión', 'Reins of Unity', 'Cords that shine when you hold them up to the light. The people of old times presented these to the King of Bountiful Harvests to express their gratitude.', 'Correas elaboradas con un tejido que brilla bajo la luz. En el pasado, los humanos las entregaban como ofrenda al Rey de las Cosechas en señal de gratitud.', false);
