('Isoguardia', 'Guard Split', 'The user employs its psychic power to average its Defense and Sp. Def stats with those of the target.', 'El usuario emplea sus poderes para hacer la media de su Defensa y Defensa Especial con las de su objetivo y compartirlas.', NULL, NULL, 'psychic', 'status'),
