('Aligerar', 'Autotomize', 'The user sheds part of its body to make itself lighter and sharply raise its Speed stat.', 'El usuario se desprende de partes prescindibles de su cuerpo para hacerse más ligero y aumentar mucho su Velocidad.', NULL, NULL, 'steel', 'status'),
