('Onda Tóxica', 'Sludge Wave', 'The user strikes everything around it by swamping the area with a giant sludge wave. This may also poison those hit.', 'Una onda tóxica que daña a los Pokémon de alrededor. Puede envenenar.', 100, 95, 'poison', 'special'),
('Danza Aleteo', 'Quiver Dance', 'The user lightly performs a beautiful, mystic dance. This boosts the user’s Sp. Atk, Sp. Def, and Speed stats.', 'Danza mística que sube el Ataque Especial, la Defensa Especial y la Velocidad.', NULL, NULL, 'bug', 'status'),
