('Enrosque', 'Coil', 'The user coils up and concentrates. This raises its Attack and Defense stats as well as its accuracy.', 'El usuario se concentra, lo que le permite aumentar  su Ataque, Defensa y Precisión.', NULL, NULL, 'poison', 'status'),
