('Cede Paso', 'After You', 'The user helps the target and makes it use its move right after the user.', 'Si el usuario es el más rápido, permite al objetivo usar un movimiento justo tras él, adelantándose a Pokémon más rápidos.', NULL, NULL, 'normal', 'status'),
