('Carga Parábola', 'Parabolic Charge', 'The user attacks everything around it. The user’s HP is restored by half the damage taken by those hit.', 'Inflige daño a todos los Pokémon a su alrededor. El usuario absorbe la mitad del daño producido para restaurar sus propios PS.', 100, 65, 'electric', 'special'),
