('Hilo Venenoso', 'Toxic Thread', 'The user shoots poisonous threads to poison the target and lower the target’s Speed stat.', 'Ataca al oponente con hilillos venenosos que reducen su Velocidad y lo envenenan.', 100, NULL, 'poison', 'status'),
('Aguzar', 'Laser Focus', 'The user concentrates intensely. The attack on the next turn always results in a critical hit.', 'El usuario se concentra para que el siguiente ataque propine un golpe crítico.', NULL, NULL, 'normal', 'status'),
('Piñón Auxiliar', 'Gear Up', 'The user engages its gears to raise the Attack and Sp. Atk stats of ally Pokémon with the Plus or Minus Ability.', 'Cambia de marcha y logra aumentar el Ataque y el Ataque Especial de los Pokémon aliados que cuenten con las habilidades Más y Menos.', NULL, NULL, 'steel', 'status'),
('Golpe Mordaza', 'Throat Chop', 'The user attacks the target’s throat, and the resultant suffering prevents the target from using moves that emit sound for two turns.', 'Inflige al rival un dolor tan abrumador que le impide utilizar durante dos turnos ataques que se sirven del sonido.', 100, 80, 'dark', 'physical'),
('Bola de Polen', 'Pollen Puff', 'The user attacks the enemy with a pollen puff that explodes. If the target is an ally, it gives the ally a pollen puff that restores its HP instead.', 'Ataca al oponente con una bola explosiva. Si esta alcanza a un aliado, le hará recuperar PS.', 100, 90, 'bug', 'special'),
('Anclaje', 'Anchor Shot', 'The user entangles the target with its anchor chain while attacking. The target becomes unable to flee.', 'Ataca lanzando un ancla al oponente, que queda atrapado y no puede huir.', 100, 80, 'steel', 'physical'),
('Campo Psíquico', 'Psychic Terrain', 'This protects Pokémon on the ground from priority moves and powers up Psychic-type moves for five turns.', 'Durante cinco turnos, se potencian los movimientos de tipo Psíquico y los Pokémon que están en el suelo quedan protegidos contra movimientos con prioridad.', NULL, NULL, 'psychic', 'status'),
('Plancha', 'Lunge', 'The user makes a lunge at the target, attacking with full force. This also lowers the target’s Attack stat.', 'Ataca al oponente abalanzándose sobre él con todas sus fuerzas y reduce su Ataque.', 100, 80, 'bug', 'physical'),
('Látigo Ígneo', 'Fire Lash', 'The user strikes the target with a burning lash. This also lowers the target’s Defense stat.', 'Golpea al oponente con un látigo incandescente y reduce su Defensa.', 100, 80, 'fire', 'physical'),
('Chulería', 'Power Trip', 'The user boasts its strength and attacks the target. The more the user’s stats are raised, the greater the move’s power.', 'Ataca al oponente presumiendo de su fuerza. Cuanto más hayan subido las características del usuario, mayor será el daño.', 100, 20, 'dark', 'physical'),
('Llama Final', 'Burn Up', 'To inflict massive damage, the user burns itself out. After using this move, the user will no longer be Fire type.', 'Utiliza hasta el último resquicio de llamas de su cuerpo para infligir un grave daño al oponente. Tras el ataque, el usuario deja de ser de tipo Fuego.', 100, 130, 'fire', 'special'),
('Cambiavelocidad', 'Speed Swap', 'The user exchanges Speed stats with the target.', 'Intercambia su Velocidad por la del oponente.', NULL, NULL, 'psychic', 'status'),
('Cuerno Certero', 'Smart Strike', 'The user stabs the target with a sharp horn. This attack never misses.', 'El usuario ensarta al adversario con su afilada cornamenta. Este movimiento acierta siempre.', NULL, 70, 'steel', 'physical'),
('Purificación', 'Purify', 'The user heals the target’s status condition. If the move succeeds, it also restores the user’s own HP.', 'Cura los problemas de estado del Pokémon rival y a cambio recupera PS propios.', NULL, NULL, 'poison', 'status'),
('Danza Despertar', 'Revelation Dance', 'The user attacks the target by dancing very hard. The user’s type determines the type of this move.', 'Ataque que consiste en un baile muy enérgico. El tipo de este ataque se corresponde con el del Pokémon que lo ejecuta.', 100, 90, 'normal', 'special'),
('Núcleo Castigo', 'Core Enforcer', 'If the Pokémon the user has inflicted damage on have already used their moves, this move eliminates the effect of the target’s Ability.', 'Inflige daño al rival, y si este ya ha hecho uso de algún movimiento, pierde su habilidad.', 100, 100, 'dragon', 'special'),
('Patada Tropical', 'Trop Kick', 'The user lands an intense kick of tropical origins on the target. This also lowers the target’s Attack stat.', 'Lanza una patada con la fuerza del trópico que golpea al rival y reduce su Ataque.', 100, 70, 'grass', 'physical'),
('Mandato', 'Instruct', 'The user instructs the target to use the target’s last move again.', 'Fuerza al objetivo a repetir inmediatamente su último movimiento.', NULL, NULL, 'psychic', 'status'),
('Pico Cañón', 'Beak Blast', 'The user first heats up its beak, and then it attacks the target. Making direct contact with the Pokémon while it’s heating up its beak results in a burn.', 'Primero aumenta la temperatura de su pico y luego ejecuta un ataque. Quema al rival si este le propina un ataque físico mientras está calentando el pico.', 100, 100, 'flying', 'physical'),
('Fragor Escamas', 'Clanging Scales', 'The user rubs the scales on its entire body and makes a huge noise to attack opposing Pokémon. The user’s Defense stat goes down after the attack.', 'Frota todas las escamas de su cuerpo para crear un fuerte sonido con el que ataca. Cuando el ataque termina, su Defensa se ve reducida.', 100, 110, 'dragon', 'special'),
('Martillo Dragón', 'Dragon Hammer', 'The user uses its body like a hammer to attack the target and inflict damage.', 'Usa el cuerpo como un martillo para abalanzarse sobre su rival y causarle daño.', 100, 90, 'dragon', 'physical'),
('Giro Vil', 'Brutal Swing', 'The user swings its body around violently to inflict damage on everything in its vicinity.', 'Hace pivotar su cuerpo para causar daño a su alrededor.', 100, 60, 'dark', 'physical'),
('Velo Aurora', 'Aurora Veil', 'This move reduces damage from physical and special moves for five turns. This can be used only in a hailstorm.', 'Reduce el daño de los ataques físicos y especiales que ejecuta el rival durante cinco turnos. Solo puede usarse cuando está granizando.', NULL, NULL, 'ice', 'status'),
('Aluvión de Flechas Sombrías', 'Sinister Arrow Raid', 'The user, Decidueye, creates countless arrows using its Z-Power and shoots the target with full force.', 'Decidueye usa el Poder Z para proyectar multitud de flechas potentísimas que atraviesan a su oponente.', NULL, 180, 'ghost', 'physical'),
('Hiperplancha Oscura', 'Malicious Moonsault', 'The user, Incineroar, strengthens its body using its Z-Power and crashes into the target with full force.', 'Incineroar refuerza sus músculos con el Poder Z para golpear con todas sus fuerzas a su oponente.', NULL, 180, 'dark', 'physical'),
('Sinfonía de la Diva Marina', 'Oceanic Operetta', 'The user, Primarina, summons a massive amount of  water using its Z-Power and attacks the target with  full force.', 'Primarina invoca ingentes cantidades de agua con el Poder Z para atacar con gran potencia a su rival.', NULL, 195, 'water', 'special'),
('Cólera del Guardián', 'Guardian of Alola', 'The user, the Land Spirit Pokémon, obtains Alola’s energy using its Z-Power and attacks the target with full force. This reduces the target’s HP greatly.', 'Los Pokémon Dios Nativo canalizan la energía de Alola gracias al Poder Z y atacan con gran fuerza a sus rivales reduciendo un gran porcentaje de sus PS.', NULL, NULL, 'fairy', 'special'),
('Constelación Robaalmas', 'Soul-Stealing 7-Star Strike', 'After obtaining Z-Power, the user, Marshadow, punches and kicks the target consecutively with full force.', 'Cuando Marshadow obtiene el Poder Z, lanza una potente y continua oleada de puñetazos y patadas con la que castiga a su rival.', NULL, 195, 'ghost', 'physical'),
('Surfeo Galvánico', 'Stoked Sparksurfer', 'After obtaining Z-Power, the user, Alolan Raichu, attacks the target with full force. This move leaves the target with paralysis.', 'Cuando un Raichu de Alola obtiene el Poder Z, lanza un potente ataque contra su enemigo y lo deja paralizado.', NULL, 175, 'electric', 'special'),
('Arrojo Intempestivo', 'Pulverizing Pancake', 'Z-Power brings out the true capabilities of the user, Snorlax. The Pokémon moves its enormous body energetically and attacks the target with full force.', 'Gracias al Poder Z, Snorlax puede mover su enorme cuerpo con gran agilidad y determinación, cargando sobre el oponente con todas sus fuerzas.', NULL, 210, 'normal', 'physical'),
('Novena Potencia', 'Extreme Evoboost', 'After obtaining Z-Power, the user, Eevee, gets energy from its evolved friends and boosts its stats sharply.', 'Cuando Eevee obtiene el Poder Z, toma prestada la energía de sus amigos evolucionados para potenciar enormemente sus características.', NULL, NULL, 'normal', 'status'),
('Supernova Original', 'Genesis Supernova', 'After obtaining Z-Power, the user, Mew, attacks the target with full force. The terrain will be charged with psychic energy.', 'Mew usa el Poder Z para realizar un potente ataque contra su adversario y crear un Campo Psíquico sobre el terreno.', NULL, 185, 'psychic', 'special'),
('Coraza Trampa', 'Shell Trap', 'The user sets a shell trap. If the user is hit by a physical move, the trap will explode and inflict damage on opposing Pokémon.', 'El caparazón del Pokémon se convierte en una trampa. Si le alcanza un ataque físico, la trampa estalla y los oponentes sufren daño.', 100, 150, 'fire', 'special'),
('Cañón Floral', 'Fleur Cannon', 'The user unleashes a strong beam. The attack’s recoil harshly lowers the user’s Sp. Atk stat.', 'El usuario emite un potente rayo, pero su Ataque Especial se reduce mucho.', 90, 130, 'fairy', 'special'),
('Psicocolmillo', 'Psychic Fangs', 'The user bites the target with its psychic capabilities. This can also destroy Light Screen and Reflect.', 'Ataca a sus rivales con poderes psíquicos que además destruyen barreras como Pantalla de Luz y Reflejo.', 100, 85, 'psychic', 'physical'),
('Pataleta', 'Stomping Tantrum', 'Driven by frustration, the user attacks the target. If the user’s previous move has failed, the power of this move doubles.', 'Usa la frustración como revulsivo para atacar. La potencia de Pataleta se duplica si el usuario ha fallado el último movimiento usado.', 100, 75, 'ground', 'physical'),
('Hueso Sombrío', 'Shadow Bone', 'The user attacks by beating the target with a bone that contains a spirit. This may also lower the target’s Defense stat.', 'Ataca al oponente golpeándole con un hueso poseído por un espíritu. Puede reducir la Defensa del objetivo.', 100, 85, 'ghost', 'physical'),
('Roca Veloz', 'Accelerock', 'The user smashes into the target at high speed. This move always goes first.', 'El usuario se lanza contra el objetivo a gran velocidad. Este movimiento tiene prioridad alta.', 100, 40, 'rock', 'physical'),
('Hidroariete', 'Liquidation', 'The user slams into the target using a full-force blast of water. This may also lower the target’s Defense stat.', 'Ataca golpeando gracias a la fuerza del agua. También puede reducir la Defensa del objetivo.', 100, 85, 'water', 'physical'),
('Láser Prisma', 'Prismatic Laser', 'The user shoots powerful lasers using the power of a prism. The user can’t move on the next turn.', 'El usuario utiliza un prisma para emitir un rayo de gran potencia, pero no puede moverse en el turno siguiente.', 100, 160, 'psychic', 'special'),
('Robasombra', 'Spectral Thief', 'The user hides in the target’s shadow, steals the target’s stat boosts, and then attacks.', 'El usuario se esconde en la sombra del objetivo y lo ataca tras robarle las mejoras en sus características.', 100, 90, 'ghost', 'physical'),
('Meteoimpacto', 'Sunsteel Strike', 'The user slams into the target with the force of a meteor. This move can be used on the target regardless of its Abilities.', 'Ataca al objetivo con la potencia de un meteoro, ignorando su habilidad.', 100, 100, 'steel', 'physical'),
('Rayo Umbrío', 'Moongeist Beam', 'The user emits a sinister ray to attack the target. This move can be used on the target regardless of its Abilities.', 'Ataca con un rayo misterioso que ignora la habilidad del objetivo.', 100, 100, 'ghost', 'special'),
('Ojos Llorosos', 'Tearful Look', 'The user gets teary eyed to make the target lose its combative spirit. This lowers the target’s Attack and Sp. Atk stats.', 'Mira al objetivo con ojos llorosos para hacerle perder su espíritu combativo y reduce su Ataque y Ataque Especial.', NULL, NULL, 'normal', 'status'),
('Electropunzada', 'Zing Zap', 'A strong electric blast crashes down on the target, giving it an electric shock. This may also make the target flinch.', 'Se lanza contra el objetivo y le suelta una potente descarga eléctrica que puede hacer que se amedrente.', 100, 80, 'electric', 'physical'),
('Furia Natural', 'Nature’s Madness', 'The user hits the target with the force of nature. It halves the target’s HP.', 'Golpea al objetivo con la furia de la naturaleza y reduce sus PS a la mitad.', 90, NULL, 'fairy', 'special'),
('Multiataque', 'Multi-Attack', 'Cloaking itself in high energy, the user slams into the target. The memory held determines the move’s type.', 'El Pokémon se rodea de una potente energía con la que golpea al rival. El tipo del movimiento depende del disco que lleva el usuario.', 100, 120, 'normal', 'physical'),
('Gigarrayo Fulminante', '10,000,000 Volt Thunderbolt', 'The user, Pikachu wearing a cap, powers up a jolt of electricity using its Z-Power and unleashes it. Critical hits land more easily.', 'Los Pikachu con gorra acumulan una carga eléctrica descomunal gracias al Poder Z y la lanzan contra el objetivo. Suele ser crítico.', NULL, 195, 'electric', 'special'),
('Cabeza Sorpresa', 'Mind Blown', 'The user attacks everything around it by causing its own head to explode. This also damages the user.', 'El usuario hace explotar su cabeza para atacar a todos los Pokémon que se hallan a su alrededor, aunque también se hiere a sí mismo.', 100, 150, 'fire', 'special'),
('Puños Plasma', 'Plasma Fists', 'The user attacks with electrically charged fists. This move changes Normal-type moves to Electric-type moves.', 'El usuario ataca con puños cargados de electricidad. Convierte los movimientos de tipo Normal en movimientos de tipo Eléctrico.', 100, 100, 'electric', 'physical'),
('Géiser Fotónico', 'Photon Geyser', 'The user attacks a target with a pillar of light. This move inflicts Attack or Sp. Atk damage—whichever stat is higher for the user.', 'El usuario ataca con una gran columna de luz. Compara sus valores de Ataque y Ataque Especial para infligir daño con el más alto de los dos.', 100, 100, 'psychic', 'special'),
('Fotodestrucción Apocalíptica', 'Light That Burns the Sky', 'This attack inflicts Attack or Sp. Atk damage— whichever stat is higher for the user, Necrozma.  This move ignores the target’s Ability.', 'Necrozma escoge la característica que tenga el valor más alto entre el Ataque y el Ataque Especial para infligir daño, ignorando la habilidad del objetivo.', NULL, 200, 'psychic', 'special'),
('Embestida Solar', 'Searing Sunraze Smash', 'After obtaining Z-Power, the user, Solgaleo, attacks the target with full force. This move can ignore the effect of the target’s Ability.', 'Solgaleo ataca con toda su fuerza tras imbuirse del Poder Z. Este movimiento ignora la habilidad del objetivo.', NULL, 200, 'steel', 'physical'),
('Deflagración Lunar', 'Menacing Moonraze Maelstrom', 'After obtaining Z-Power, the user, Lunala, attacks the target with full force. This move can ignore the effect of the target’s Ability.', 'Lunala ataca con toda su fuerza tras imbuirse del Poder Z. Este movimiento ignora la habilidad del objetivo.', NULL, 200, 'ghost', 'special'),
('Somanta Amistosa', 'Let’s Snuggle Forever', 'After obtaining Z-Power, the user, Mimikyu, punches the target with full force.', 'Mimikyu ataca con toda su fuerza tras imbuirse del Poder Z y asesta una lluvia de golpes.', NULL, 190, 'fairy', 'physical'),
('Tempestad Rocosa', 'Splintered Stormshards', 'After obtaining Z-Power, the user, Lycanroc, attacks the target with full force. This move negates the effect on the battlefield.', 'Lycanroc ataca con toda su fuerza tras imbuirse del Poder Z y neutraliza el campo que esté activo.', NULL, 190, 'rock', 'physical'),
('Estruendo Implacable', 'Clangorous Soulblaze', 'After obtaining Z-Power, the user, Kommo-o, attacks the opposing Pokémon with full force. This move boosts the user’s stats.', 'Kommo-o ataca con toda su fuerza al objetivo tras imbuirse del Poder Z. Además, potencia sus propias características.', NULL, 185, 'dragon', 'special'),
('Pikaturbo', 'Zippy Zap', 'The user attacks the target with bursts of electricity at high speed. This move always goes first and results in a critical hit.', 'Ataque eléctrico a la velocidad del rayo. Este movimiento tiene prioridad alta y propina golpes críticos.', 100, 80, 'electric', 'physical'),
('Salpikasurf', 'Splishy Splash', 'The user charges a huge wave with electricity and hits the opposing Pokémon with the wave. This may also leave the opposing Pokémon with paralysis.', 'Golpea al adversario con una ola gigante electrificada, que también puede paralizarlo.', 100, 90, 'water', 'special'),
('Pikapicado', 'Floaty Fall', 'The user floats in the air, and then dives at a steep angle to attack the target. This may also make the target flinch.', 'El usuario se suspende en el aire para, a continuación, abalanzarse súbitamente sobre el rival. Puede hacer retroceder al objetivo.', 95, 90, 'flying', 'physical'),
('Pikatormenta', 'Pika Papow', 'The more Pikachu loves its Trainer, the greater the move’s power. It never misses.', 'Lanza una descarga eléctrica infalible que resulta más potente cuanto mayor es el cariño que siente Pikachu hacia su Entrenador.', NULL, NULL, 'electric', 'special'),
('Vapodrenaje', 'Bouncy Bubble', 'The user attacks by shooting water bubbles at the target. It then absorbs water and restores its HP by half the damage taken by the target.', 'Ataca lanzando proyectiles de agua y recupera una cantidad de PS equivalente a la mitad del daño causado.', 100, 60, 'water', 'special'),
('Joltioparálisis', 'Buzzy Buzz', 'The user shoots a jolt of electricity to attack the target. This also leaves the target with paralysis.', 'Lanza una potente descarga eléctrica sobre el rival y lo deja paralizado.', 100, 60, 'electric', 'special'),
('Flarembestida', 'Sizzly Slide', 'The user cloaks itself in fire and charges at the target. This also leaves the target with a burn.', 'Tras envolver su cuerpo en llamas, el usuario arrolla con fuerza al rival y le provoca quemaduras.', 100, 60, 'fire', 'physical'),
('Espeaura', 'Glitzy Glow', 'The user bombards the target with telekinetic force. A wondrous wall of light is put up to weaken the power of the opposing Pokémon’s special moves.', 'Envuelve al rival con ondas psíquicas y alza un extraño muro que debilita los ataques especiales del adversario.', 95, 80, 'psychic', 'special'),
('Umbreozona', 'Baddy Bad', 'The user acts bad and attacks the target. A wondrous wall of light is put up to weaken the power of the opposing Pokémon’s physical moves.', 'Lanza un ataque haciendo gala de su faceta más umbría y alza un extraño muro que mitiga los ataques físicos del adversario.', 95, 80, 'dark', 'special'),
('Leafitobombas', 'Sappy Seed', 'The user grows a gigantic stalk that scatters seeds to attack the target. The seeds drain the target’s HP every turn.', 'Hace brotar un tallo gigante que bombardea al rival con unas semillas que le drenan PS en cada turno.', 90, 100, 'grass', 'physical'),
('Glaceoprisma', 'Freezy Frost', 'The user attacks with a crystal made of cold frozen haze. It eliminates every stat change among all the Pokémon engaged in battle.', 'Ataca al rival con negros cristales de niebla congelada. Revierte los cambios en las características de todos los Pokémon presentes.', 90, 100, 'ice', 'special'),
('Sylveotornado', 'Sparkly Swirl', 'The user attacks the target by wrapping it with a whirlwind of an overpowering scent. This also heals all status conditions of the user’s party.', 'Ataca al rival envolviéndolo en un remolino de aroma asfixiante. Cura a los aliados de cualquier problema de estado.', 85, 120, 'fairy', 'special'),
('Eevimpacto', 'Veevee Volley', 'The more Eevee loves its Trainer, the greater the move’s power. It never misses.', 'Un placaje infalible que resulta más potente cuanto mayor es el cariño que siente Eevee hacia su Entrenador.', NULL, NULL, 'normal', 'physical'),
('Ferropuño Doble', 'Double Iron Bash', 'The user rotates, centering the hex nut in its chest, and then strikes with its arms twice in a row. This may also make the target flinch.', 'Usando la tuerca del pecho como eje, gira sobre sí mismo y golpea con los brazos dos veces seguidas. Puede amedrentar al rival.', 100, 60, 'steel', 'physical'),
('Maxibarrera', 'Max Guard', 'This move enables the user to protect itself from all attacks. Its chance of failing rises if it is used in succession.', 'Frena todos los ataques, pero puede fallar si se usa repetidamente.', NULL, NULL, 'normal', 'status'),
('Cañón Dinamax', 'Dynamax Cannon', 'The user unleashes a strong beam from its core. This move deals twice the damage if the target is Dynamaxed.', 'El usuario ataca emitiendo un rayo desde su núcleo. El daño infligido se duplica si el objetivo ha alcanzado el estado Dinamax.', 100, 100, 'dragon', 'special'),
('Disparo Certero', 'Snipe Shot', 'The user ignores the effects of opposing Pokémon’s moves and Abilities that draw in moves, allowing this move to hit the chosen target.', 'Permite atacar al objetivo seleccionado ignorando las habilidades o movimientos que permiten a un rival centrar la atención sobre sí.', 100, 80, 'water', 'special'),
('Presa Maxilar', 'Jaw Lock', 'This move prevents the user and the target from switching out until either of them faints. The effect goes away if either of the Pokémon leaves the field.', 'Impide que tanto el atacante como el defensor puedan ser intercambiados hasta que uno de ellos se debilite o abandone el terreno de combate.', 100, 80, 'dark', 'physical'),
('Atiborramiento', 'Stuff Cheeks', 'The user eats its held Berry, then sharply raises its Defense stat.', 'El usuario ingiere la baya que lleva equipada para aumentar mucho su Defensa.', NULL, NULL, 'normal', 'status'),
('Bastión Final', 'No Retreat', 'This move raises all the user’s stats but prevents the user from switching out or fleeing.', 'El usuario aumenta todas sus características, pero ya no puede huir ni ser cambiado por otro.', NULL, NULL, 'fighting', 'status'),
('Alquitranazo', 'Tar Shot', 'The user pours sticky tar over the target, lowering the target’s Speed stat. The target becomes weaker to Fire-type moves.', 'Cubre al objetivo de un alquitrán pegajoso que reduce su Velocidad y lo vuelve débil contra el fuego.', 100, NULL, 'rock', 'status'),
('Polvo Mágico', 'Magic Powder', 'The user scatters a cloud of magic powder that changes the target to Psychic type.', 'Cubre al objetivo con unos polvos mágicos que le hacen adquirir el tipo Psíquico.', 100, NULL, 'psychic', 'status'),
('Dracoflechas', 'Dragon Darts', 'The user attacks twice using Dreepy. If there are two targets, this move hits each target once.', 'El usuario ataca propulsando a ambos Dreepy. En caso de haber dos adversarios, cada Dreepy golpea a su propio objetivo por separado.', 100, 50, 'dragon', 'physical'),
('Hora del Té', 'Teatime', 'The user has teatime with all the Pokémon in the battle. Each Pokémon eats its held Berry.', 'El usuario invita a tomar el té a todos los presentes en el terreno de combate, lo que hace que ingieran las bayas que lleven equipadas.', NULL, NULL, 'normal', 'status'),
('Octopresa', 'Octolock', 'The user locks the target in and prevents it from fleeing. This move also lowers the target’s Defense and Sp. Def every turn.', 'Retiene al objetivo para impedir su huida, a la vez que reduce su Defensa y Defensa Especial cada turno.', 100, NULL, 'fighting', 'status'),
('Electropico', 'Bolt Beak', 'The user stabs the target with its electrified beak. If the user attacks before the target, the power of this move is doubled.', 'El usuario ensarta al objetivo con su pico cargado de electricidad. Si ataca en primer lugar, la potencia del movimiento se duplica.', 100, 85, 'electric', 'physical'),
('Branquibocado', 'Fishious Rend', 'The user rends the target with its hard gills. If the user attacks before the target, the power of this move is doubled.', 'El usuario agarra al objetivo con sus duras branquias. En caso de atacar antes que este último, la potencia del movimiento se duplica.', 100, 85, 'water', 'physical'),
('Cambio de Cancha', 'Court Change', 'With its mysterious power, the user swaps the effects on either side of the field.', 'Extraño poder que intercambia los efectos en el terreno de combate de ambos bandos.', 100, NULL, 'normal', 'status'),
('Maxignición', 'Max Flare', 'This is a Fire-type attack Dynamax Pokémon use. The user intensifies the sun for five turns.', 'Ataque de tipo Fuego ejecutado por un Pokémon Dinamax. Hace que se intensifique el efecto del sol durante cinco turnos.', NULL, 100, 'fire', 'physical'),
('Maxinsecto', 'Max Flutterby', 'This is a Bug-type attack Dynamax Pokémon use. This lowers the target’s Sp. Atk stat.', 'Ataque de tipo Bicho ejecutado por un Pokémon Dinamax. Reduce el Ataque Especial del objetivo.', NULL, 10, 'bug', 'physical'),
