('Maxiataque', 'Max Strike', 'This is a Normal-type attack Dynamax Pokémon use. This lowers the target’s Speed stat.', 'Ataque de tipo Normal ejecutado por un Pokémon Dinamax. Reduce la Velocidad del objetivo.', NULL, 10, 'normal', 'physical'),
('Maxipuño', 'Max Knuckle', 'This is a Fighting-type attack Dynamax Pokémon use. This raises ally Pokémon’s Attack stats.', 'Ataque de tipo Lucha ejecutado por un Pokémon Dinamax. Aumenta el Ataque de tu bando.', NULL, 10, 'fighting', 'physical'),
('Maxiespectro', 'Max Phantasm', 'This is a Ghost-type attack Dynamax Pokémon use. This lowers the target’s Defense stat.', 'Ataque de tipo Fantasma ejecutado por un Pokémon Dinamax. Reduce la Defensa de los rivales.', NULL, 10, 'ghost', 'physical'),
('Maxihelada', 'Max Hailstorm', 'This is an Ice-type attack Dynamax Pokémon use. The user summons a hailstorm lasting five turns.', 'Ataque de tipo Hielo ejecutado por un Pokémon Dinamax. Crea una tormenta de granizo que dura cinco turnos.', NULL, 10, 'ice', 'physical'),
('Maxiácido', 'Max Ooze', 'This is a Poison-type attack Dynamax Pokémon use. This raises ally Pokémon’s Sp. Atk stats.', 'Ataque de tipo Veneno ejecutado por un Pokémon Dinamax. Aumenta el Ataque Especial de tu bando.', NULL, 10, 'poison', 'physical'),
('Maxichorro', 'Max Geyser', 'This is a Water-type attack Dynamax Pokémon use. The user summons a heavy rain that falls for five turns.', 'Ataque de tipo Agua ejecutado por un Pokémon Dinamax. Desata un aguacero que dura cinco turnos.', NULL, 10, 'water', 'physical'),
('Maxiciclón', 'Max Airstream', 'This is a Flying-type attack Dynamax Pokémon use. This raises ally Pokémon’s Speed stats.', 'Ataque de tipo Volador ejecutado por un Pokémon Dinamax. Aumenta la Velocidad de tu bando.', NULL, 10, 'flying', 'physical'),
('Maxiestela', 'Max Starfall', 'This is a Fairy-type attack Dynamax Pokémon use. The user turns the ground into Misty Terrain for five turns.', 'Ataque de tipo Hada ejecutado por un Pokémon Dinamax. Crea un campo de niebla durante cinco turnos.', NULL, 10, 'fairy', 'physical'),
('Maxidraco', 'Max Wyrmwind', 'This is a Dragon-type attack Dynamax Pokémon use. This lowers the target’s Attack stat.', 'Ataque de tipo Dragón ejecutado por un Pokémon Dinamax. Reduce el Ataque del objetivo.', NULL, 10, 'dragon', 'physical'),
('Maxionda', 'Max Mindstorm', 'This is a Psychic-type attack Dynamax Pokémon use. The user turns the ground into Psychic Terrain for five turns.', 'Ataque de tipo Psíquico ejecutado por un Pokémon Dinamax. Crea un campo psíquico durante cinco turnos.', NULL, 10, 'psychic', 'physical'),
('Maxilito', 'Max Rockfall', 'This is a Rock-type attack Dynamax Pokémon use. The user summons a sandstorm lasting five turns.', 'Ataque de tipo Roca ejecutado por un Pokémon Dinamax. Levanta una tormenta de arena que dura cinco turnos.', NULL, 10, 'rock', 'physical'),
('Maxitemblor', 'Max Quake', 'This is a Ground-type attack Dynamax Pokémon use. This raises ally Pokémon’s Sp. Def stats.', 'Ataque de tipo Tierra ejecutado por un Pokémon Dinamax. Aumenta la Defensa Especial de tu bando.', NULL, 10, 'ground', 'physical'),
('Maxisombra', 'Max Darkness', 'This is a Dark-type attack Dynamax Pokémon use. This lowers the target’s Sp. Def stat.', 'Ataque de tipo Siniestro ejecutado por un Pokémon Dinamax. Reduce la Defensa Especial del objetivo.', NULL, 10, 'dark', 'physical'),
('Maxiflora', 'Max Overgrowth', 'This is a Grass-type attack Dynamax Pokémon use. The user turns the ground into Grassy Terrain for five turns.', 'Ataque de tipo Planta ejecutado por un Pokémon Dinamax. Crea un campo de hierba durante cinco turnos.', NULL, 10, 'grass', 'physical'),
('Maximetal', 'Max Steelspike', 'This is a Steel-type attack Dynamax Pokémon use. This raises ally Pokémon’s Defense stats.', 'Ataque de tipo Acero ejecutado por un Pokémon Dinamax. Aumenta la Defensa de tu bando.', NULL, 10, 'steel', 'physical'),
('Estruendo Escama', 'Clangorous Soul', 'The user raises all its stats by using some of its HP.', 'Utiliza parte de los PS propios para subir sus características.', 100, NULL, 'dragon', 'status'),
('Plancha Corporal', 'Body Press', 'The user attacks by slamming its body into the target. The higher the user’s Defense, the more damage it can inflict on the target.', 'El usuario usa el cuerpo para lanzar su ataque e infligir un daño directamente proporcional a su Defensa.', 100, 80, 'fighting', 'physical'),
('Decoración', 'Decorate', 'The user sharply raises the target’s Attack and Sp. Atk stats by decorating the target.', 'Aumenta mucho el Ataque y el Ataque Especial del objetivo al decorarlo.', NULL, NULL, 'fairy', 'status'),
('Batería Asalto', 'Drum Beating', 'The user plays its drum, controlling the drum’s roots to attack the target. This also lowers the target’s Speed stat.', 'El usuario controla un tocón mediante la percusión y al atacar reduce la Velocidad del objetivo.', 100, 80, 'grass', 'physical'),
('Cepo', 'Snap Trap', 'The user snares the target in a snap trap for four to five turns.', 'Cepo que atrapa al objetivo durante cuatro o cinco turnos y le causa daño mientras se encuentra preso.', 100, 35, 'grass', 'physical'),
('Balón Ígneo', 'Pyro Ball', 'The user attacks by igniting a small stone and launching it as a fiery ball at the target. This may also leave the target with a burn.', 'El usuario prende una pequeña piedra para crear una bola de fuego con la que ataca al rival. Puede causar quemaduras.', 90, 120, 'fire', 'physical'),
('Tajo Supremo', 'Behemoth Blade', 'The user becomes a gigantic sword and cuts the target. This move deals twice the damage if the target is Dynamaxed.', 'El usuario se convierte en una espada gigante para rebanar al objetivo. Si este ha alcanzado el estado Dinamax, se duplica el daño infligido.', 100, 100, 'steel', 'physical'),
('Embate Supremo', 'Behemoth Bash', 'The user becomes a gigantic shield and slams into the target. This move deals twice the damage if the target is Dynamaxed.', 'El usuario se convierte en un escudo gigante para golpear al objetivo. Si este ha alcanzado el estado Dinamax, se duplica el daño infligido.', 100, 100, 'steel', 'physical'),
('Rueda Aural', 'Aura Wheel', 'Morpeko attacks and raises its Speed with the energy stored in its cheeks. This move’s type changes depending on the user’s form.', 'La energía que acumula en las mejillas le sirve para atacar y aumentar su Velocidad. Este movimiento cambia de tipo según la forma que adopte Morpeko.', 100, 110, 'electric', 'physical'),
('Vasto Impacto', 'Breaking Swipe', 'The user swings its tough tail wildly and attacks opposing Pokémon. This also lowers their Attack stats.', 'El usuario sacude violentamente su enorme cola para golpear a todos los rivales y reducir su Ataque a la par.', 100, 60, 'dragon', 'physical'),
('Punzada Rama', 'Branch Poke', 'The user attacks the target by poking it with a sharply pointed branch.', 'Ataca pinchando al objetivo con una rama afilada.', 100, 40, 'grass', 'physical'),
('Amplificador', 'Overdrive', 'The user attacks opposing Pokémon by twanging a guitar or bass guitar, causing a huge echo and strong vibration.', 'El usuario rasguea la guitarra o el bajo para generar enormes vibraciones de intensa reverberación con las que ataca al objetivo.', 100, 80, 'electric', 'special'),
('Ácido Málico', 'Apple Acid', 'The user attacks the target with an acidic liquid created from tart apples. This also lowers the target’s Sp. Def stat.', 'Ataca al objetivo con el fluido corrosivo que desprende una manzana ácida, lo que también disminuye la Defensa Especial de este.', 100, 80, 'grass', 'special'),
('Fuerza G', 'Grav Apple', 'The user inflicts damage by dropping an apple from high above. This also lowers the target’s Defense stat.', 'El usuario ataca haciendo caer una manzana desde gran altura. Disminuye la Defensa del objetivo.', 100, 80, 'grass', 'physical'),
('Choque Anímico', 'Spirit Break', 'The user attacks the target with so much force that it could break the target’s spirit. This also lowers the target’s Sp. Atk stat.', 'El usuario ataca al objetivo con tal ímpetu que acaba minando su moral y, en consecuencia, reduce su Ataque Especial.', 100, 75, 'fairy', 'physical'),
('Cautivapor', 'Strange Steam', 'The user attacks the target by emitting steam. This may also confuse the target.', 'Desprende un humo con el que ataca al objetivo, que puede acabar confundido.', 95, 90, 'fairy', 'special'),
('Gota Vital', 'Life Dew', 'The user scatters mysterious water around and restores the HP of itself and its ally Pokémon in the battle.', 'Vierte un agua misteriosa y balsámica que restaura tanto sus propios PS como los de aquellos aliados presentes en el terreno de combate.', NULL, NULL, 'water', 'status'),
('Obstrucción', 'Obstruct', 'This move enables the user to protect itself from all attacks. Its chance of failing rises if it is used in succession. Direct contact harshly lowers the attacker’s Defense stat.', 'Frena todos los ataques, pero puede fallar si se usa repetidamente. Reduce mucho la Defensa de quien ejecute un movimiento de contacto contra el usuario.', 100, NULL, 'dark', 'status'),
('Irreverencia', 'False Surrender', 'The user pretends to bow its head, but then it stabs the target with its disheveled hair. This attack never misses.', 'El usuario finge hacer una reverencia y aprovecha la ocasión para ensartar al objetivo con su cabello alborotado. Siempre acierta.', NULL, 80, 'dark', 'physical'),
('Asalto Estelar', 'Meteor Assault', 'The user attacks wildly with its thick leek. The user can’t move on the next turn, because the force of this move makes it stagger.', 'El usuario agita violentamente su grueso puerro para atacar, pero el mareo que le provocan las sacudidas le impide moverse en el turno siguiente.', 100, 150, 'fighting', 'physical'),
('Rayo Infinito', 'Eternabeam', 'This is Eternatus’s most powerful attack in its original form. The user can’t move on the next turn.', 'Este es el mayor ataque de Eternatus una vez adquirida su forma original. No puede moverse en el turno siguiente.', 90, 160, 'dragon', 'special'),
('Metaláser', 'Steel Beam', 'The user fires a beam of steel that it collected from its entire body. This also damages the user.', 'Utiliza el acero de su cuerpo para disparar un potente rayo. También hiere al agresor.', 95, 140, 'steel', 'special'),
('Vasta Fuerza', 'Expanding Force', 'The user attacks the target with its psychic power. This move’s power goes up and damages all opposing Pokémon on Psychic Terrain.', 'El usuario ataca al objetivo con sus poderes psíquicos. Cuando se usa en conjunción con un campo psíquico, aumenta su potencia e inflige daño a todos los rivales.', 100, 80, 'psychic', 'special'),
('Allanador Férreo', 'Steel Roller', 'The user attacks while destroying the terrain. This move fails when the ground hasn’t turned into a terrain.', 'El usuario lanza su ataque y destruye el campo activo en el terreno de combate, y falla si no hay ninguno en ese momento.', 100, 130, 'steel', 'physical'),
('Ráfaga Escamas', 'Scale Shot', 'The user attacks by shooting scales two to five times in a row. This move boosts the user’s Speed stat but lowers its Defense stat.', 'Lanza escamas al objetivo de dos a cinco veces seguidas. Aumenta la Velocidad del usuario, pero reduce su Defensa.', 90, 25, 'dragon', 'physical'),
('Rayo Meteórico', 'Meteor Beam', 'In this two-turn attack, the user gathers space power and boosts its Sp. Atk stat, then attacks the target on the next turn.', 'El usuario dedica el primer turno a aumentar su Ataque Especial acumulando energía cósmica y lanza su ofensiva contra el objetivo en el segundo.', 90, 120, 'rock', 'special'),
('Moluscañón', 'Shell Side Arm', 'This move inflicts physical or special damage, whichever will be more effective. This may also poison the target.', 'El usuario lanza un ataque físico o especial en función de cuál inflija más daño. Puede envenenar al objetivo.', 100, 90, 'poison', 'special'),
('Bruma Explosiva', 'Misty Explosion', 'The user attacks everything around it and faints upon using this move. This move’s power is increased on Misty Terrain.', 'El usuario ataca a todos a su alrededor, pero se debilita de inmediato. La potencia del movimiento aumenta si el terreno está cubierto por un campo de niebla.', 100, 100, 'fairy', 'special'),
('Fitoimpulso', 'Grassy Glide', 'Gliding on the ground, the user attacks the target. This move always goes first on Grassy Terrain.', 'Ataca al objetivo deslizándose sobre el terreno de combate. Este movimiento tiene prioridad alta cuando el terreno está cubierto por un campo de hierba.', 100, 55, 'grass', 'physical'),
('Alto Voltaje', 'Rising Voltage', 'The user attacks with electric voltage rising from the ground. This move’s power doubles when the target is on Electric Terrain.', 'Ataca con una descarga eléctrica que surge del terreno de combate. La potencia del movimiento se duplica si el rival se ve afectado por un campo eléctrico.', 100, 70, 'electric', 'special'),
('Pulso de Campo', 'Terrain Pulse', 'The user utilizes the power of the terrain to attack. This move’s type and power changes depending on the terrain when it’s used.', 'El usuario ataca aprovechando la energía del campo activo, que determina tanto el tipo como la potencia del movimiento.', 100, 50, 'normal', 'special'),
('Golpe Rastrero', 'Skitter Smack', 'The user skitters behind the target to attack. This also lowers the target’s Sp. Atk stat.', 'Ataca al objetivo por la espalda de forma subrepticia y además reduce su Ataque Especial.', 90, 70, 'bug', 'physical'),
('Envidia Ardiente', 'Burning Jealousy', 'The user attacks with energy from jealousy. This leaves all opposing Pokémon that have had their stats boosted during the turn with a burn.', 'Ataca al objetivo con la energía generada por la envidia y causa quemaduras a los Pokémon cuyas características hayan aumentado en ese turno.', 100, 70, 'fire', 'special'),
('Desahogo', 'Lash Out', 'The user lashes out to vent its frustration toward the target. If the user’s stats were lowered during this turn, the power of this move is doubled.', 'Ataca al rival presa de la rabia. Si el usuario ha sufrido una reducción de características en ese turno, la potencia del movimiento se duplica.', 100, 75, 'dark', 'physical'),
('Poltergeist', 'Poltergeist', 'The user attacks the target by controlling the target’s item. The move fails if the target doesn’t have an item.', 'El usuario ataca utilizando el objeto que lleva el rival. Si no tiene ninguno equipado, el movimiento falla.', 90, 110, 'ghost', 'physical'),
('Gas Corrosivo', 'Corrosive Gas', 'The user surrounds everything around it with highly acidic gas and melts away items they hold.', 'El usuario libera un gas cáustico que envuelve a todos los que se encuentren alrededor y derrite por completo los objetos que lleven equipados.', 100, NULL, 'poison', 'status'),
('Motivación', 'Coaching', 'The user properly coaches its ally Pokémon, boosting their Attack and Defense stats.', 'El usuario imparte indicaciones precisas a sus aliados, que ven aumentados su Ataque y su Defensa.', NULL, NULL, 'fighting', 'status'),
('Viraje', 'Flip Turn', 'After making its attack, the user rushes back to switch places with a party Pokémon in waiting.', 'Tras atacar, el usuario da paso a toda prisa a otro Pokémon del equipo.', 100, 60, 'water', 'physical'),
('Triple Axel', 'Triple Axel', 'A consecutive three-kick attack that becomes more powerful with each successful hit.', 'Patea hasta tres veces seguidas y cada vez más fuerte.', 90, 20, 'ice', 'physical'),
('Ala Bis', 'Dual Wingbeat', 'The user slams the target with its wings. The target is hit twice in a row.', 'Ataca al adversario golpeándolo dos veces con las alas.', 90, 40, 'flying', 'physical'),
('Arenas Ardientes', 'Scorching Sands', 'The user throws scorching sand at the target to attack. This may also leave the target with a burn.', 'Ataca al objetivo arrojándole arena a temperaturas muy elevadas. Puede causar quemaduras.', 100, 70, 'ground', 'special'),
('Cura Selvática', 'Jungle Healing', 'The user becomes one with the jungle, restoring HP and healing any status conditions of itself and its ally Pokémon in battle.', 'Al entrar en plena armonía con la selva, el usuario cura problemas de estado y restaura PS no solo de sí mismo, sino también de los aliados presentes en el terreno.', NULL, NULL, 'grass', 'status'),
('Golpe Oscuro', 'Wicked Blow', 'The user, having mastered the Dark style, strikes the target with a fierce blow. This attack always results in a critical hit.', 'Golpe devastador que requiere un absoluto dominio de las artes siniestras. Siempre asesta un golpe crítico.', 100, 75, 'dark', 'physical'),
('Azote Torrencial', 'Surging Strikes', 'The user, having mastered the Water style, strikes the target with a flowing motion three times in a row. This attack always results in a critical hit.', 'El usuario, dominador absoluto del líquido elemento, golpea hasta tres veces con movimientos fluidos. Siempre asesta un golpe crítico.', 100, 25, 'water', 'physical'),
('Electrojaula', 'Thunder Cage', 'The user traps the target in a cage of sparking electricity for four to five turns.', 'El objetivo queda atrapado en una jaula electrificada que permanece en el terreno de cuatro a cinco turnos.', 90, 80, 'electric', 'special'),
('Dracoenergía', 'Dragon Energy', 'Converting its life-force into power, the user attacks opposing Pokémon. The lower the user’s HP, the lower the move’s power.', 'El usuario convierte su fuerza vital en una energía con la que ataca al objetivo. Cuantos menos PS tenga el usuario, menor será la potencia del movimiento.', 100, 150, 'dragon', 'special'),
('Mirada Heladora', 'Freezing Glare', 'The user shoots its psychic power from its eyes to attack. This may also leave the target frozen.', 'A través de sus ojos emite poderes psíquicos con los que ataca al objetivo, al que puede llegar a congelar.', 100, 90, 'psychic', 'special'),
('Furia Candente', 'Fiery Wrath', 'The user transforms its wrath into a fire-like aura to attack. This may also make opposing Pokémon flinch.', 'El usuario convierte su ira en un aura flamígera para lanzar su ataque. Puede amedrentar al objetivo.', 100, 90, 'dark', 'special'),
('Patada Relámpago', 'Thunderous Kick', 'The user overwhelms the target with lightning-like movement before delivering a kick. This also lowers the target’s Defense stat.', 'El usuario desconcierta al rival con movimientos centelleantes y le propina una patada. Baja la Defensa del objetivo.', 100, 90, 'fighting', 'physical'),
('Lanza Glacial', 'Glacial Lance', 'The user attacks by hurling a blizzard-cloaked icicle lance at opposing Pokémon.', 'El usuario ataca al objetivo lanzándole un carámbano de hielo envuelto en una ventisca.', 100, 120, 'ice', 'physical'),
('Orbes Espectro', 'Astral Barrage', 'The user attacks by sending a frightful amount of small ghosts at opposing Pokémon.', 'El usuario ataca al objetivo lanzándole una ingente cantidad de pequeños fantasmas.', 100, 120, 'ghost', 'special'),
('Conjuro Funesto', 'Eerie Spell', 'The user attacks with its tremendous psychic power. This also removes 3 PP from the target’s last move.', 'El usuario ataca con un poder psíquico de inmensa potencia y elimina 3 PP del último movimiento que haya usado el objetivo.', 100, 80, 'psychic', 'special');
